import './AASC.scss';
import aascImg from '../../assets/images/AASC-card.png';

function AASC() {
  return(
    <div className='section'>
      <section className='hero-image'>
        <img src={aascImg} alt='Asian American Studies Center Hero Image'/>
      </section>
    </div>
  );
};

export default AASC;
